import React from "react";
import Image from "./Image";
import goat from "../images/goat.png";

const ImageView: React.FC = () => {

  return (
      <>
        <div className=" bg-amber-200 w-screen h-screen flex items-center justify-center text-8xl">
            <Image image={goat} />
        </div>
        <div className=" bg-teal-200 w-screen  h-screen flex items-center justify-center text-8xl">
            <Image image={goat} />
        </div>
        <div className=" bg-cyan-200 w-screen h-screen flex items-center justify-center text-8xl">
            <Image image={goat} />
        </div>
        <div className=" bg-fuchsia-200 w-screen h-screen flex items-center justify-center text-8xl">
            <Image image={goat} />
        </div>
      </>
  );
}

export default ImageView;
